import {Visualization} from "../types/visualization.type";
import {SearchFilter} from "../../searchFilters/types/searchFilters.type";
import {filtersToUrl} from "../../searchFilters/types/filtersToUrl.service";

export async function searchVisualizations(searchFilters:SearchFilter[]):Promise<Visualization>{
    let searchQuery:string = filtersToUrl(searchFilters);
    let fullUrl:string = `/sqlViews/VisNavgSrch/data?var=limit:100`
    return Promise.resolve(null as any as Visualization);
}
